import React, { useContext } from 'react';
import Link from '@material-ui/core/Link';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Title from './Title';
import moment from 'moment';
import { DataContext } from '../Providers/DataProvider';

function preventDefault(event) {
  event.preventDefault();
}

const useStyles = makeStyles(theme => ({
  seeMore: {
    marginTop: theme.spacing(3),
  },
}));

export default function Node() {
  const classes = useStyles();
  const { data } = useContext(DataContext);
  const rows = Object.values(data);
  return (
    <React.Fragment>
      <Title>Node Monitoring</Title>
            <iframe
                src={'http://localhost:3000/d-solo/-ZMj5jH7z/node-exporter-quickstart-and-dashboard?orgId=1&from=1632981940304&to=1632985540304&theme=light&panelId=2" width="400" height="200" frameborder="3"'} />
            <iframe
                src={'http://localhost:3000/d-solo/-ZMj5jH7z/node-exporter-quickstart-and-dashboard?orgId=1&from=1632981940304&to=1632985540304&theme=light&panelId=2" width="450" height="200" frameborder="0"'} />


            <div className={classes.seeMore}>
        <Link color="primary" href="#" onClick={preventDefault}>
          See more orders
        </Link>
      </div>
    </React.Fragment>
  );
}
